CREATE TRIGGER [dbo].[A_Collection_deleteCollection] 
ON [dbo].[A_Collection] 
FOR DELETE AS
BEGIN
    SET NOCOUNT ON
    DECLARE @nRows INT;
    DECLARE @CID int;
    DECLARE @DeletedIDs TABLE (
        CollectionID int
    );

    INSERT INTO @DeletedIDs
    SELECT [CollectionID]
    FROM DELETED;

    SELECT @nRows = COUNT(*) FROM @DeletedIDs;

    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CID = CollectionID FROM @DeletedIDs;

        Delete FROM [A_CollectionItem] where CollectionID = @CID

		update A_CollectionClass set DefaultCollectionID = 0 where exists( select 1 from A_CollectionClass cc where DefaultCollectionID = @CID)

        DELETE FROM @DeletedIDs 
        WHERE CollectionID = @CID;

        SELECT @nRows = COUNT(*) FROM @DeletedIDs;
    END;
  END;
 GO

