CREATE TRIGGER [dbo].[A_CollectionClass_deleteClass] 
ON [dbo].[A_CollectionClass] 
FOR DELETE AS
BEGIN
    SET NOCOUNT ON
    DECLARE @nRows INT;
    DECLARE @CCID int;
    DECLARE @DeletedIDs TABLE (
        ClassID int
    );

    INSERT INTO @DeletedIDs
    SELECT [CollectionClassID]
    FROM DELETED;

    SELECT @nRows = COUNT(*) FROM @DeletedIDs;

    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CCID = ClassID FROM @DeletedIDs;

        DELETE FROM [A_Collection] where CollectionClassID = @CCID;

        DELETE FROM @DeletedIDs 
        WHERE ClassID = @CCID;

        SELECT @nRows = COUNT(*) FROM @DeletedIDs;
    END;
  END;
 GO
 

CREATE TRIGGER [dbo].[A_CollectionClass_createClass] 
ON [dbo].[A_CollectionClass] 
AFTER INSERT 
AS
BEGIN

    SET NOCOUNT ON
    DECLARE @nRows INT;
    DECLARE @CCID int;
	DECLARE @CID int;
	DECLARE @Type nvarchar(100)
    DECLARE @InsertIDs TABLE (
        ClassID int,
		CollectionType nvarchar(100)
    );

    INSERT INTO @InsertIDs
    SELECT [CollectionClassID], [DefaultCollectionType]
    FROM INSERTED;

    SELECT @nRows = COUNT(*) FROM @InsertIDs;

    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CCID = ClassID, @Type = CollectionType FROM @InsertIDs;

        INSERT INTO [A_Collection] ([Name],[Order],[CollectionClassID],[Type]) VALUES ('Default',0,@CCID,@Type)
		SELECT @CID = SCOPE_IDENTITY()
		
		UPDATE [A_CollectionClass] set DefaultCollectionID = @CID where CollectionClassID = @CCID

        DELETE FROM @InsertIDs 
        WHERE ClassID = @CCID;

        SELECT @nRows = COUNT(*) FROM @InsertIDs;
    END;

END;
 GO

