CREATE TRIGGER [dbo].[A_CollectionItem_deleteItem] 
ON [dbo].[A_CollectionItem] 
FOR DELETE AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

    DECLARE @ItemCollections TABLE (
        CollectionID int,
		[Table] nvarchar(250),
		[Field] nvarchar(250),
		[IdentityID] nvarchar(250),
		[BitPosition] smallint
    );

	INSERT INTO @ItemCollections
    SELECT distinct d.[CollectionID], b.[Table], b.[Field], b.[IdentityID], b.[BitPosition]
    FROM DELETED d 
	LEFT JOIN [ARM_CORE]..[A_BitCondition] b on b.ConditionCID = d.[CollectionID] where NOt b.BitPosition IS NULL;

	DECLARE @nRows INT;
    DECLARE @CID int;
    DECLARE @TABLE nvarchar(250);
    DECLARE @FIELD nvarchar(250);
    DECLARE @IDENTITY nvarchar(250);
    DECLARE @BITPOS smallint;

	DECLARE @query nvarchar(3000);

    SELECT @nRows = COUNT(*) FROM @ItemCollections;


    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CID = [CollectionID], @TABLE = [Table], @FIELD = [Field], @IDENTITY = [IdentityID], @BITPOS = [BitPosition] FROM @ItemCollections ;

		set @query = 'update [ARM_CORE]..[' + @TABLE + '] set [' + @FIELD + '] = [' + @FIELD + '] - case when Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) & [' + @FIELD + '] > 0 then Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) else 0 end'

		EXECUTE(@query)

		set @query = '
			MERGE [ARM_CORE]..[' + @TABLE + '] as TARGET
			USING (
				select ItemID, Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) as BitValue from [ARM_CORE]..[A_CollectionItem] where collectionID = ' + cast(@CID as nvarchar(20)) + '
			) as SOURCE
			On (TARGET.[' + @IDENTITY + '] = SOURCE.[ItemID])
			WHEN MATCHED THEN
				UPDATE set TARGET.[' + @FIELD + '] = IsNull(TARGET.[' + @FIELD + '],0) + SOURCE.[BitValue] ;
		'	

		EXECUTE(@query)


        DELETE FROM @ItemCollections 
        WHERE [CollectionID] = @CID and [BitPosition] = @BITPOS

        SELECT @nRows = COUNT(*) FROM @ItemCollections;
    END;

END

 GO
 CREATE TRIGGER [dbo].[A_CollectionItem_insertItem] 
ON [dbo].[A_CollectionItem] 
FOR INSERT AS
BEGIN
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;

-- IF CLASS is marked as DISTINCT remove items with same values as those just inserted that are found in Collections belonging to target collection Class but NOT the target collection itself.

	MERGE [ARM_CORE]..[A_CollectionItem] as TARGET
	USING ( 
		select distinct i.itemID, i.CollectionID from [ARM_CORE]..[A_Collection] c
		LEFT JOIN [ARM_CORE]..[A_CollectionItem] i on i.CollectionID = c.CollectionID
		LEFT JOIN (
			select distinct z.ItemID, z.collectionID, cc.collectionClassID as classID from 
				INSERTED z
			LEFT JOIN [A_Collection] cc on cc.CollectionID = z.collectionID 
			LEFT JOIN [A_CollectionClass] ccc on ccc.CollectionClassID = cc.CollectionClassID
			where ccc.[Distinct] = 1
		) y on y.ItemID COLLATE DATABASE_DEFAULT = i.ItemID COLLATE DATABASE_DEFAULT
		where c.CollectionClassID = y.ClassID and c.CollectionID <> y.collectionID and y.ItemID IS NOT NULL
	) as SOURCE
	On (TARGET.[ItemID] = SOURCE.[Itemid] and TARGET.[CollectionID] = SOURCE.[CollectionID]) 
	WHEN MATCHED THEN
		DELETE;




-- MAKE SURE BITSTATUS IS UPDATED IF RELEVANT

    DECLARE @ItemCollections TABLE (
        CollectionID int,
		[Table] nvarchar(250),
		[Field] nvarchar(250),
		[IdentityID] nvarchar(250),
		[BitPosition] smallint
    );

	INSERT INTO @ItemCollections
    SELECT distinct d.[CollectionID], b.[Table], b.[Field], b.[IdentityID], b.[BitPosition]
    FROM INSERTED d 
	LEFT JOIN [ARM_CORE]..[A_BitCondition] b on b.ConditionCID = d.[CollectionID] where NOt b.BitPosition IS NULL;

	DECLARE @nRows INT;
    DECLARE @CID int;
    DECLARE @TABLE nvarchar(250);
    DECLARE @FIELD nvarchar(250);
    DECLARE @IDENTITY nvarchar(250);
    DECLARE @BITPOS smallint;

	DECLARE @query nvarchar(3000);

    SELECT @nRows = COUNT(*) FROM @ItemCollections;


    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CID = [CollectionID], @TABLE = [Table], @FIELD = [Field], @IDENTITY = [IdentityID], @BITPOS = [BitPosition] FROM @ItemCollections ;

		set @query = 'update [ARM_CORE]..[' + @TABLE + '] set [' + @FIELD + '] = [' + @FIELD + '] - case when Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) & [' + @FIELD + '] > 0 then Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) else 0 end'

		EXECUTE(@query)

		set @query = '
			MERGE [ARM_CORE]..[' + @TABLE + '] as TARGET
			USING (
				select ItemID, Power(CONVERT(bigint,2),' + cast(@BITPOS as nvarchar(20)) + '-1) as BitValue from [ARM_CORE]..[A_CollectionItem] where collectionID = ' + cast(@CID as nvarchar(20)) + '
			) as SOURCE
			On (TARGET.[' + @IDENTITY + '] = SOURCE.[ItemID])
			WHEN MATCHED THEN
				UPDATE set TARGET.[' + @FIELD + '] = IsNull(TARGET.[' + @FIELD + '],0) + SOURCE.[BitValue] ;
		'	

		EXECUTE(@query)


        DELETE FROM @ItemCollections 
        WHERE [CollectionID] = @CID and [BitPosition] = @BITPOS

        SELECT @nRows = COUNT(*) FROM @ItemCollections;
    END;


	-- Modes are as follows
--  SYNCHRONISE  -  0 - MERGE & PURGE  (target collection retains exact copy of source collection only )
--  COLLECT      -  1 - MERGE NO PURGE  (add new items identified from source collection to those items already present in target collection)
--  SIEVE        -  2 - NEW TO CLASS ONLY & PURGE   (only add to target collection if items do not appear in class collections already)


	DECLARE @CollectionEvents TABLE (
        CollectionID int,
		[EventID] int,
		[EventType] [nvarchar](250),
		[SynchroniseType] [nvarchar](250) ,
		[ActionRef] [nvarchar](250) ,
		[SQL] [nvarchar](max) ,
		[TargetCollectionRef] [nvarchar](250) ,
		[TemplateID] [int] ,
		[Order] [int],
		[Distinct] [bit] ,
		[CollectionClassID] [int] ,
		[TargetID] [int] ,
		[TargetClassID] [int] ,
		[TargetDistinct] [bit] 
    );

	INSERT INTO @CollectionEvents
	SELECT distinct d.[CollectionID]
      ,e.[EventID]
	  ,e.[EventType]
      ,e.[SynchroniseType]
      ,e.[ActionRef]
      ,e.[SQL]
      ,e.[TargetCollectionRef]
      ,e.[TemplateID]
	  ,e.[Order]
	  ,cc.[Distinct]
	  ,cc.[CollectionClassID]
	  ,t.CollectionID as [TargetID]
	  ,t.CollectionClassID as [TargetClassID]
	  ,tt.[Distinct] AS [TargetDistinct]
	FROM INSERTED d 
	LEFT JOIN [Sys_Event] e on e.[CollectionID] = d.[CollectionID] 
	LEFT JOIN [A_Collection] c on c.CollectionID = d.CollectionID
	LEFT JOIN [A_CollectionClass] cc on cc.CollectionClassID = c.CollectionClassID
	LEFT JOIN [A_Collection] t on t.CREF = e.[TargetCollectionRef] and IsNull(t.CREF,'') <> ''
	LEFT JOIN [A_CollectionClass] tt on tt.CollectionClassID = t.CollectionClassID
	where e.Active = 1 and e.EventType like 'immediate%'

    DECLARE @EVENTID int;
    DECLARE @EVENTTYPE nvarchar(250);
    DECLARE @SYNCHRONISETYPE nvarchar(250);
    DECLARE @ACTIONREF nvarchar(250);
    DECLARE @SQL nvarchar(max);
    DECLARE @TARGETREF nvarchar(250);
    DECLARE @TEMPLATEID int;
    DECLARE @Distinct bit;
    DECLARE @CollectionClassID int;

	DECLARE @TargetID int;
    DECLARE @TargetClassID int;
    DECLARE @TargetDistinct bit;

	DECLARE @mSQL NVARCHAR(MAX);
	DECLARE @params NVARCHAR(1000);

    SELECT @nRows = COUNT(*) FROM @CollectionEvents;

	WHILE @nRows > 0
	BEGIN
		SELECT TOP 1 @CID = [CollectionID], @EVENTID = [EventID], @EVENTTYPE = [EventType], @SYNCHRONISETYPE = [SynchroniseType]
			, @Distinct = [Distinct],  @CollectionClassID = [CollectionClassID]
			, @TargetID = [TargetID],  @TargetDistinct = [TargetDistinct],  @TargetClassID = [TargetClassID]
			, @ACTIONREF = [ActionRef], @TARGETREF = [TargetCollectionRef], @TEMPLATEID = [TemplateID], @SQL = [SQL] 
		FROM @CollectionEvents order by [Order] ;


		if @EVENTTYPE = 'Immediate Synchronise'
		BEGIN
			EXEC [SYS_EVENT_SYNCHRONISE] @EVENTID
		END

		if @EVENTTYPE = 'Immediate Script'
		BEGIN
			DECLARE @TriggerItems TriggerItem

			-- Capture those items that meet the Day Trigger criteria

			INSERT INTO @TriggerItems select distinct i.itemID from INSERTED i

			-- The SQL can include references to @collectionID and @TriggerItems.
			-- we can extend this to include others as need be.

			SET @params = N'@collectionID INT,  @TriggerItems TriggerItem readonly'
			EXEC sp_executesql @SQL, @params, @collectionID = @CID, @TriggerItems = @TriggerItems
		END

		DELETE FROM @CollectionEvents 
		WHERE [CollectionID] = @CID and [EventID] = @EVENTID

		SELECT @nRows = COUNT(*) FROM @CollectionEvents;
	END
END
 GO

