 -- =============================================
-- Author:          <Author,,Name>
-- Create date: <Create Date,,>
-- Description:     <Description,,>
-- =============================================
CREATE TRIGGER [dbo].[A_Task_insert] 
ON  [dbo].[A_Task]
FOR INSERT AS
BEGIN
       -- SET NOCOUNT ON added to prevent extra result sets from
       -- interfering with SELECT statements.
       SET NOCOUNT ON;

    -- Insert statements for trigger here

    insert into [Alert] (UserID, Title, [Message], [Sticky],[URL],[TaskID])
    SELECT distinct t.[UserID], t.[Group], IsNull(Replace(Replace(Replace(a.Header,'{CLASSNAME}',t.[group]),'{CNAME}',t.CNAME),'{ITEMID}',t.ItemID),'You have a New task'), 0, '/TaskMonitor/',t.TaskID
    FROM INSERTED t LEFT JOIN ARM_CORE..[A_TaskAction] a on a.ActionID = t.ActionID

    DECLARE @SendToUsers TABLE (
        [SendToID] [int] IDENTITY(1,1) NOT NULL,
        [ItemID] nvarchar(255),
        [UserID] nvarchar(255),
        [Email] nvarchar(255),
        [FirstName] nvarchar(255),
        [TaskID] int
    );

    INSERT INTO @SendToUsers
    SELECT distinct t.ItemID, t.[UserID], u.Email, IsNull(u.Firstname,'') as Firstname, t.TaskID
    FROM INSERTED t 
    LEFT JOIN [A_TaskAction] a on a.ActionID = t.ActionID
    LEFT JOIN [User] u on u.UserID = t.UserID
    where IsNull(a.SendMail,0) = 1


    DECLARE @minID INT;
    DECLARE @maxID INT;

    DECLARE @UserID nvarchar(255);
    DECLARE @Email nvarchar(255);
    DECLARE @ItemID nvarchar(255);
    DECLARE @FirstName nvarchar(255);
    DECLARE @TaskID int;

    DECLARE @query nvarchar(3000);

    -- SYS-Task Notification

    DECLARE @templateID INT,
            @params NVARCHAR(255),
            @messagetext NVARCHAR(max),     
            @templatetext NVARCHAR(max), 
            @messagetextOut NVARCHAR(max),
            @subject NVARCHAR(max), 
            @messagesubject NVARCHAR(max),
            @type NVARCHAR(100), 
            @dataset nvarchar(100),
            @signaturePath NVARCHAR(100), 
            @signatureMarker  NVARCHAR(100),
            @signatureReplacementMarker  NVARCHAR(100),
            @attachment NVARCHAR(max),       
            @SendFrom NVARCHAR(255),
            @ReplyTo NVARCHAR(255),
            @BccTo NVARCHAR(255),
            @ReadReceipt BIT,
            @Important BIT, 
            @RecipientID INT,
			@CNAME NVARCHAR(255),
			@CLASSNAME NVARCHAR(255),
            @datasetSQL NVARCHAR(MAX)   

    select top 1 @templateID = t.TemplateID 
            ,@templatetext = isNull(t.Template,'')
            ,@subject = isNull(t.[subject],'')
            ,@dataset = isNull(t.dataset,0)
            ,@datasetSQL = IsNull(d.SQLStatement,'')
            ,@Important = IsNull(t.Important,0)
            ,@ReadReceipt = IsNull(t.ReadReceipt,0)
            ,@SendFrom = IsNull(t.SendFrom,0)
            ,@BccTo = IsNull(t.BCC,0)
    FROM NotificationTemplate t 
    LEFT JOIN [A_templateSQLStatement] d on d.templateSQLStatementID = t.dataset
    WHERE t.[Label] = 'SYS-Task Notification'

    -- Replace all Snippets with their respective text. 

    IF CHARINDEX('{SNIP_',@templatetext) > 0 
    BEGIN
            EXEC dbo.sp_MailerSnippets @templatetext, @messagetextOut OUTPUT
            SET @templatetext = @messagetextOut
    END    
             
    --replaces images.  Images must be loaded into database
    IF CHARINDEX('{IMAGE',@templatetext) > 0 
    BEGIN  
            EXEC [sp_MailerImages] @templatetext, @messagetextOut OUTPUT
            SET @templatetext = @messagetextOut
            --SET @attachment = CONCAT(@attachment, @signaturePath)
    END    



       -- Now send it

    SELECT @minID = MIN(SendToID), @maxID = MAX(SendToID) FROM @SendToUsers

    WHILE @minID <= @maxID 
    BEGIN
        SELECT @UserID = s.UserID, @Email = s.Email, @ItemID = s.ItemID, @FirstName = s.Firstname, @TaskID = s.TaskID, @CNAME = t.CNAME, @CLASSNAME = t.[Group] FROM @SendToUsers s LEFT JOIN [A_Task] t on t.TaskID = s.TaskID where s.SendToID = @minID;

             set @messagetext = @templatetext
             set @messagesubject = @subject

             SELECT @messagetext = REPLACE(@messagetext, '{ITEMID}', @ItemID) 
             SELECT @messagetext = REPLACE(@messagetext, '{EMAIL}', @Email) 
             SELECT @messagetext = REPLACE(@messagetext, '{USERID}', @UserID) 
             SELECT @messagetext = REPLACE(@messagetext, '{FIRSTNAME}', @FirstName) 
             SELECT @messagetext = REPLACE(@messagetext, '{CNAME}', @CNAME) 
             SELECT @messagetext = REPLACE(@messagetext, '{CLASSNAME}', @CLASSNAME) 

             SELECT @messagesubject = REPLACE(@messagesubject, '{ITEMID}', @ItemID) 
             SELECT @messagesubject = REPLACE(@messagesubject, '{EMAIL}', @Email) 
             SELECT @messagesubject = REPLACE(@messagesubject, '{USERID}', @UserID) 
             SELECT @messagesubject = REPLACE(@messagesubject, '{FIRSTNAME}', @FirstName) 
             SELECT @messagesubject = REPLACE(@messagesubject, '{CNAME}', @CNAME) 
             SELECT @messagesubject = REPLACE(@messagesubject, '{CLASSNAME}', @CLASSNAME) 

             INSERT INTO A_MailerLog (MailTo, MailFrom, ReadReceipt, [BCC], Important, [subject], body, attachment)
             VALUES(       @Email, @SendFrom, @readReceipt, @BccTo, @Important, @messagesubject, @messagetext, @attachment)

             INSERT INTO NotificationLog(name, Owner, email, AssetID, WhenSent, AutoNotificationID, TemplateUsed, Status, Type, CollectionID, TemplateID)
             VALUES('Task Trigger Mailer '+cast(@TaskID as nvarchar(20)), @UserID,@Email, @ItemID,  getdate(), -1, 'SYS-Task Notification', '','trigger', 0, @TemplateID )


        SELECT @minID = MIN(SendToID) FROM @SendToUsers where SendToID > @minID
    END;

END


 GO

