CREATE TRIGGER [dbo].[Bookmark_deleteBookmark] 
ON [dbo].[Bookmarks] 
FOR DELETE AS
BEGIN
    SET NOCOUNT ON
    DECLARE @nRows INT;
    DECLARE @CID int;
    DECLARE @BookmarkIDs TABLE (
        BookmarkID int
    );

    INSERT INTO @BookmarkIDs
    SELECT [BookmarkID]
    FROM DELETED;

    SELECT @nRows = COUNT(*) FROM @BookmarkIDs;

    WHILE @nRows > 0
    BEGIN
        SELECT TOP 1 @CID = BookmarkID FROM @BookmarkIDs;

        Delete FROM [A_RequestCapture] where BookmarkID = @CID

        DELETE FROM @BookmarkIDs 
        WHERE [BookmarkID] = @CID;

        SELECT @nRows = COUNT(*) FROM @BookmarkIDs;
    END;
  END;
 GO

