CREATE TRIGGER [dbo].[tStock_AddtoNotAssigned]
   ON [dbo].[Stock]
   AFTER INSERT
AS 
BEGIN

	INSERT INTO ARM_CORE..A_CollectionItem ([ItemID],[CollectionID])
	select * from (
		select distinct s.SerialNumber as ItemID, (select top 1 x.CollectionID from ARM_CORE..A_Collection x where  x.CREF = 'STOCK_Discovery') as CollectionID from ARM_CORE..Stock s
		LEFT JOIN (
			select distinct s.* from ARM_CORE..A_CollectionItem i
			left join ARM_CORE..Stock s on s.SerialNumber = i.ItemID
			left join ARM_CORE..A_Collection c on c.CollectionID = i.CollectionID
			LEFT JOIN [ARM_CORE]..[A_CollectionClass] cc on cc.collectionClassID = c.CollectionClassID
			where cc.ClassRef = 'STOCK' and NOT s.SerialNumber IS NULL
		) z on z.serialNumber = s.SerialNumber
		where z.serialNumber IS NULL
	) y where NOT y.CollectionID IS NULL

END

 GO
 CREATE TRIGGER [dbo].[tStock_deleteItem] 
ON [dbo].[Stock] 
FOR DELETE AS
BEGIN
    SET NOCOUNT ON

    DECLARE @StockClassID int;
	SELECT @StockClassID = collectionClassID from [ARM_CORE]..[A_CollectionClass] where ClassRef = 'STOCK'


	DELETE FROM [A_CollectionItem] where ItemID COLLATE DATABASE_DEFAULT in (
		select distinct i.ItemID from ARM_CORE..A_CollectionItem i
		left join ARM_CORE..Stock s on s.SerialNumber = i.ItemID
		left join ARM_CORE..A_Collection c on c.CollectionID = i.CollectionID
		where c.CollectionClassID = @StockClassID and s.SerialNumber IS NULL
	) and CollectionID in (select c.CollectionID from [ARM_CORE]..[A_Collection] c where c.CollectionClassID = @StockClassID)

  END;


 GO

