CREATE TRIGGER [dbo].[tSendMail]
   ON  [dbo].[A_MailerLog]
   AFTER INSERT
AS 
BEGIN
	SET NOCOUNT ON;
	DECLARE @maxTableID INT, 
			@minTableID INT,
			@mailID INT

	DECLARE @TempID AS TABLE
        (
            Id BIGINT IDENTITY,
            mailID INT NOT NULL
        );

    INSERT INTO @TempID (mailID)
    SELECT a.mailID
    FROM Inserted a;
	
	 SELECT @maxTableID = MAX(a.Id),
            @minTableID = MIN(a.Id)
    FROM @TempID a;

    WHILE (@maxTableID >= @minTableID)
    BEGIN
			SELECT @mailID = mailID 
			FROM @TempID
			WHERE ID = @minTableID

			EXEC dbo.sp_sendSingleEmail	@mailID
		
		SET @minTableID = @minTableID + 1;
	END

	

END

 GO

