CREATE TRIGGER [dbo].[tNewTMPRAWTable]
   ON [dbo].[FileStore]
   AFTER INSERT
AS 
BEGIN

       SET NOCOUNT ON;
       DECLARE @tableName VARCHAR(255), 
                    @importTableName VARCHAR(255),
                    @recordCount INT,
                    @columnNames NVARCHAR(1000),
                    @colID INT, 
                    @maxColID INT

       SELECT @tableName = [FileName],
             @importTableName = TableName
       FROM inserted

       IF RIGHT(@tableName,8) =  '_trigger'
       BEGIN
             SET @tableName = LEFT(@tablename, LEN(@tablename)-8)
             print @tablename
       
             --SELECT @colID = min(column_id) , 
             --           @maxColID = MAX(column_id)
             --FROM sys.columns where object_id = object_id('dbo.' + @tableName)

             SELECT @colID = min(column_id) , 
                           @maxColID = MAX(column_id)
             FROM sys.columns s
             LEFT JOIN [a_tableEdit] e on e.[Column] = s.name and e.[Table] = @tableName
             where s.object_id = object_id('dbo.' + @tablename) and IsNull(e.UploadExclude,0) = 0

			 


             WHILE @colID <=@maxColID
             BEGIN
                    IF @colID  = 1
                    BEGIN
                           SELECT @columnNames = '[' + name + ']'
                           FROM sys.columns 
                           WHERE object_id = object_id('dbo.' + @tableName)
                                 AND column_id = @colID
                    END
                    ELSE
                    BEGIN
                           SELECT @columnNames = CONCAT( @columnNames,',[', name,  ']')
                           FROM sys.columns 
                           WHERE object_id = object_id('dbo.' + @tableName)
                                 AND column_id = @colID
                    END

					If LEFT(@columnNames,1) = ','
					BEGIN
						SET @columnNames  = RIGHT(@columnNames,LEN(@columnNames)-1)
					END
             
                    SELECT @colID = min(column_id) 
                    FROM sys.columns s
                    LEFT JOIN [a_tableEdit] e on e.[Column] = s.name and e.[Table] = @tableName
                    where s.object_id = object_id('dbo.' +  @tableName) and IsNull(e.UploadExclude,0) = 0
                           AND column_id > @colID
             END

                    IF (select count(*) from A_TablePermit   WHERE Uploadable = 1 
                           and [Table] = @tableName) = 1
                    BEGIN

                    SET @recordCount = 1
             
                    WHILE @recordCount > 0
                    BEGIN
--                         SELECT  @recordCount = COUNT(*)
--                         FROM sys.dm_tran_locks 
--                         WHERE resource_associated_entity_id = object_id('dbo.' + @tableName )

                           set @recordCount = 0

                           IF @recordCount = 0
                           BEGIN
                             
                                        DECLARE @token UNIQUEIDENTIFIER
                                 --     exec spInsertInto @tablename, @cols,@rawTableTable

                                        exec [ARM_CORE]..[sp_merge] @tablename, @columnNames, @importTableName

                                        --EXEC usp_AsyncExecInvoke @procedureName = N'sp_merge'
                                        --           ,@p1  = @tablename,  @n1 = N'@tableName'
                                        --           ,@p2  = @columnNames, @n2 = N'@columnNames'
                                        --           ,@p3  = @importTableName, @n3 = N'@importTableName'
                                        --           ,@token = @token OUTPUT
                   
                           END 
                    END
             END
       END
END


 GO

