INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('1','Asset','SELECT  DISTINCT ''ASSET'' as [NOTIFICATIONTYPE],  a.USERID, IsNull(a.[Email],'''') as [SendToEmail],IsNull(u.[FirstName],'''') as [FirstName],a.[ASSETID],a.[ASSETTAG],IsNull(a.[Email],'''') AS OWNEREMAIL,IsNull(a.[Owner],'''') AS [OWNER] 				,IsNull(a.[Location],'''') AS LOCATION,a.[OS],a.[BArea]		,a.[MODEL],a.[TYPE],IsNull(a.Custom01,'''') as CUSTOM01,IsNull(a.Custom02,'''') as CUSTOM02,IsNull(a.Custom03,'''') as CUSTOM03,IsNull(a.Custom04,'''') as CUSTOM04 ,IsNull(a.Custom05,'''') as CUSTOM05 into ##tempdata from [ARM_CORE]..[Asset] a  LEFT JOIN [ARM_CORE]..[User] u on u.[UserID] = a.[UserID]where a.AssetID = @itemid','Asset','Asset')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('2','AppGroup','SELECT a.AppGroupID, a.AppGroupName, a.Platform, a.Category, a.ApplicationOwner, a.ApplicationOwnerEmail, a.Description, a.Vendor, a.Notes, a.CurrentApplication, a.VendorURL, a.AutoMappingPattern, a.LicenceType, a.LicenceDetails, a.Language, a.BusinessArea, a.TestLevel, a.LicenceCost, a.LicenceRisk, a.LicenceTracking, a.AlternativeApp, a.AlternativeCost, coalesce(c.email, u.email) as useremail , c.ContactType, u.UserName, u.FirstName,u.FirstName as appowner,ROW_NUMBER() OVER (order by u.UserID ) as userID INTO ##tempData FROM [ARM_CORE]..AppGroup a LEFT JOIN [ARM_CORE]..[Contact] c ON a.AppGroupID = c.ItemID LEFT JOIN [ARM_CORE]..[User] u ON C.UserID = U.UserID WHERE a.AppGroupID =  @itemID','AppGroup','')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('3','Schedule','SELECT	r.[AssetID], &#x0D;
		COALESCE(a.[Email],'''') AS userEmail, &#x0D;
		COALESCE(a.[Email],'''') AS [OWNEREMAIL], &#x0D;
		COALESCE(a.[Owner],'''') AS [Owner], &#x0D;
		COALESCE(a.[USERID],'''') AS [USERID], &#x0D;
		COALESCE(a.[Location],'''') AS Location, &#x0D;
		r.[RUNID], &#x0D;
		d.[RunDate] AS [DATE],&#x0D;
		d.[RunDate] AS [RUNDATE], &#x0D;
		d.[RunDate] AS [BDATE], &#x0D;
		a.[TYPE], &#x0D;
		COALESCE(b.BID,''-1'') as BID, &#x0D;
		COALESCE(t.TID,''-1'') AS TID, &#x0D;
		COALESCE(t.Label,''UNSPECIFIED'') as BTIME, &#x0D;
		a.[OS], &#x0D;
		a.[BArea],&#x0D;
		COALESCE(u.[FIRSTNAME],''Colleague'') as FIRSTNAME, &#x0D;
		COALESCE(m.ToBeModel,'''') as ToBeModel, &#x0D;
		COALESCE(a.Custom01,'''') as Custom01, COALESCE(a.Custom02,'''') AS Custom02, &#x0D;
		COALESCE(a.Custom03,'''') as Custom03, COALESCE(a.Custom04,'''') as Custom04,&#x0D;
		COALESCE(a.Custom05,'''') as Custom05,&#x0D;
		d.[ChannelID] as [CID], &#x0D;
		c.[Name] AS [CHANNEL], &#x0D;
		d.[SLOTID], c.WorkstreamID, &#x0D;
		DATEName(month,d.[RunDate]) as [MONTH], &#x0D;
		COALESCE(i.TheText,'''') AS BINSTRUCTIONS,&#x0D;
		ROW_NUMBER() OVER(ORDER BY r.[AssetID]) as row_&#x0D;
		INTO ##TEMPDATA&#x0D;
from ScheduleDeployRun AS d &#x0D;
INNER JOIN ScheduleDeployRunAsset AS r ON r.RunID = d.RunID  &#x0D;
INNER JOIN Asset a  ON a.AssetID = r.AssetID  &#x0D;
LEFT JOIN ScheduleChannel c ON c.ChannelID = d.ChannelID  &#x0D;
LEFT JOIN ScheduleBookDay b ON b.ChannelID = d.ChannelID and b.TheDate = d.RunDate  &#x0D;
LEFT JOIN ScheduleBooking z ON z.AssetID = r.AssetID  and z.RunID = d.RunID&#x0D;
LEFT JOIN ScheduleTimeSlot t on t.BID = b.BID and t.TID = z.TID  &#x0D;
LEFT JOIN ScheduleInstruction i ON i.ChannelID = d.ChannelID  &#x0D;
LEFT JOIN [User] u on u.UserID = a.UserID &#x0D;
LEFT JOIN ModelToBe m ON m.AssetID = r.AssetID &#x0D;
LEFT JOIN NotificationLog n on  n.Email = a.Email and DATEDIFF(d, n.WhenSent, { fn NOW() }) = 0 and n.templateID = @templateID&#x0D;
WHERE DATEDIFF(day, RunDate, GETDATE()) in ( @Offset  ) AND &#x0D;
		COALESCE(d.ChannelID,-1) = @ChannelID and COALESCE(a.[Email],'''') &lt;&gt; '''' &#x0D;
			and n.NotificationLogID IS NULL','','')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('4','COLLECTION-ASSET','SELECT  DISTINCT ''ASSET'' as [NOTIFICATIONTYPE], &#x0D;
				i.[TAGGEDON], &#x0D;
				DATEDIFF(d, i.[TAGGEDON], { fn NOW() }) as DaysSince,&#x0D;
				a.[ASSETID], a.[ASSETTAG], &#x0D;
				i.[ITEMID], &#x0D;
				IsNull(a.[Email],'''') AS OWNEREMAIL,&#x0D;
				IsNull(u.[Email],'''') AS userEmail,&#x0D;
				a.BAREA, IsNull(a.[Owner],'''') AS [OWNER], &#x0D;
				IsNull(u.[FirstName],'''') AS FIRSTNAME, &#x0D;
				IsNull(a.[Location],'''') AS LOCATION, a.[OS], &#x0D;
				a.[MODEL], &#x0D;
				a.[TYPE], i.[COLLECTIONID],&#x0D;
				IsNull(m.ToBeModel,'''') as TOBEMODEL, &#x0D;
				IsNull(a.Custom01,'''') as CUSTOM01, &#x0D;
				IsNull(a.Custom02,'''') as CUSTOM02,&#x0D;
				IsNull(a.Custom03,'''') as CUSTOM03,&#x0D;
				IsNull(a.Custom04,'''') as CUSTOM04, &#x0D;
				IsNull(a.Custom05,'''') as CUSTOM05,&#x0D;
				ROW_NUMBER() OVER(ORDER BY a.[AssetID]) as row_&#x0D;
				into ##TEMPDATA&#x0D;
				from [ARM_CORE]..[A_CollectionItem] i&#x0D;
				LEFT JOIN [ARM_CORE]..[Asset] a  ON a.AssetID = i.ItemID &#x0D;
				LEFT JOIN [ARM_CORE]..[User] u on u.[Email] = a.[Email]&#x0D;
				LEFT JOIN [ARM_CORE]..[ModelToBe] m ON m.AssetID = a.AssetID  &#x0D;
				LEFT JOIN NotificationLog n on  n.Email = a.Email and DATEDIFF(d, n.WhenSent, { fn NOW() }) = 0 and n.templateID = @templateID&#x0D;
				where i.CollectionID = @ChannelID  &#x0D;
					AND IsNULL(a.[Email],'''') &lt;&gt; ''''&#x0D;
					AND n.NotificationLogID is null&#x0D;
				Order by i.[TaggedOn] ','Asset','')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('5','COLLECTION-USER','SELECT  ''USER'' as NOTIFICATIONTYPE,&#x0D;
		i.TAGGEDON,&#x0D;
		DATEDIFF(d, i.TAGGEDON, { fn NOW() }) as DaysSince,&#x0D;
		USERID, &#x0D;
		i.ITEMID, &#x0D;
		USERNAME,&#x0D;
		DEPARTMENT, &#x0D;
		BUSINESSUNIT,&#x0D;
		LOCATION ,JOBTITLE, &#x0D;
		VIP, &#x0D;
		TELEPHONE,&#x0D;
		MOBILE,&#x0D;
		u.Email as USEREMAIL,&#x0D;
		LIVE, &#x0D;
		HEARTBEAT,&#x0D;
		NOTES, &#x0D;
		CUSTOM01, &#x0D;
		CUSTOM02, &#x0D;
		CUSTOM03, &#x0D;
		CUSTOM04, &#x0D;
		CUSTOM05, &#x0D;
		FIRSTNAME, &#x0D;
		DOMAIN, &#x0D;
		DIRECTMANAGER , &#x0D;
		i.COLLECTIONID,&#x0D;
		ROW_NUMBER() OVER(ORDER BY u.userid) as row_&#x0D;
		into ##tempdata&#x0D;
		from ARM_CORE..A_CollectionItem i&#x0D;
		INNER JOIN   ARM_CORE..User u on u.UserID = i.ItemID&#x0D;
		LEFT JOIN NotificationLog n on  n.Email = u.Email and DATEDIFF(d, n.WhenSent, { fn NOW() }) = 0 and n.templateID = @templateID&#x0D;
		where i.CollectionID = @ChannelID &#x0D;
			AND IsNULL(u.Email,'''') &lt;&gt; ''''&#x0D;
			AND n.NotificationLogID is null&#x0D;
		Order by i.TaggedOn','User','')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('6','BookingConfirm','SELECT  a.[Email] as useremail, a.[Owner], a.[Location], IsNull(a.[Type],'''') AS [Type], IsNull(a.[AssetTag],''No Asset Tag'') AS [AssetTag], IsNull(a.[Model],'''') AS [Model], IsNull(u.Firstname, ''Colleague'') as Firstname, IsNull(a.UserID,'''') as userID,      IsNull(a.[Custom01],'''') as Custom01, IsNull(a.[Custom02],'''') as Custom02, IsNull(a.[Custom03],'''') as Custom03, IsNull(a.[Custom04],'''') as Custom04, IsNull(a.[Custom05],'''') as Custom05  ,COALESCE(sts.Label,''UNSPECIFIED'') as BTIME   , DATENAME(weekday, sbd.TheDate)  + '' '' + FORMAT(sbd.TheDate, ''D'', ''en-gb'') as BDATE    ,DATENAME(weekday, sbd.TheDate)  + '' '' + FORMAT(sbd.TheDate, ''D'', ''en-gb'') as DATE  &#x0D;
,ROW_NUMBER() OVER(ORDER BY u.userid) as row_  , a.assetID ,&#x0D;
CONCAT((select concat(PropertyValue,''/Booking/MakeBooking.asp?assetid='')  from SystemGlobalProperties where PropertyName  = ''HTTPSERVER''), a.assetID) as [Bookme]&#x0D;
--CONCAT(''https://arm.jra-consultancy.co.uk/Booking/MakeBooking.asp?assetid='', a.assetID) as [Bookme]&#x0D;
INTO ##tempData    &#x0D;
FROM [ARM_CORE]..[Asset] a INNER JOIN [ARM_CORE]..[User] u on u.UserID = a.UserID      INNER JOIN [ARM_CORE]..ScheduleBooking sb on a.AssetID = sb.AssetID      INNER JOIN [ARM_CORE]..[ScheduleTimeSlot] sts on sb.TID = sts.TID      INNER JOIN [ARM_CORE]..[ScheduleBookDay] sbd on sts.BID = sbd.BID  &#x0D;
WHERE a.AssetID = @itemID','','')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('7','BookingCancel','SELECT  a.[Email] as useremail, a.[Owner], a.[Location], IsNull(a.[Type],'''') AS [Type], IsNull(a.[AssetTag],''No Asset Tag'') AS [AssetTag], IsNull(a.[Model],'''') AS [Model], IsNull(u.Firstname, ''Colleague'') as Firstname, IsNull(a.UserID,'''') as userID,      IsNull(a.[Custom01],'''') as Custom01, IsNull(a.[Custom02],'''') as Custom02, IsNull(a.[Custom03],'''') as Custom03, IsNull(a.[Custom04],'''') as Custom04, IsNull(a.[Custom05],'''') as Custom05     , DATENAME(weekday, sbd.TheDate)  + '' '' + FORMAT(sbd.TheDate, ''D'', ''en-gb'') as DATE    ,&#x0D;
--ROW_NUMBER() OVER(ORDER BY u.userid) as row_  , a.assetID , CONCAT(''https://arm.jra-consultancy.co.uk/Booking/MakeBooking.asp?assetid='', a.assetID) as [Bookme]&#x0D;
  CONCAT((select concat(PropertyValue,''/Booking/MakeBooking.asp?assetid='')  from SystemGlobalProperties where PropertyName  = ''HTTPSERVER''), a.assetID) as [Bookme]&#x0D;
  INTO ##tempData     FROM [ARM_CORE]..[Asset] a INNER JOIN [ARM_CORE]..[User] u on u.UserID = a.UserID      INNER JOIN [ARM_CORE]..ScheduleBooking sb on a.AssetID = sb.AssetID      INNER JOIN [ARM_CORE]..[ScheduleTimeSlot] sts on sb.TID = sts.TID      INNER JOIN [ARM_CORE]..[ScheduleBookDay] sbd on sts.BID = sbd.BID     WHERE a.AssetID = @itemID','','')
GO
