INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('12','Event - App - Owner','SELECT  DISTINCT ''APPLICATION'' as [NOTIFICATIONTYPE]&#x0D;
		,@ItemID as ItemID&#x0D;
		,iif(IsNull(c.Email,'''')='''',IsNull(u.[Email],''''),c.Email) as [SendToEmail]&#x0D;
&#x0D;
		,a.*&#x0D;
		,IsNull(u.[Email],'''') AS userEmail&#x0D;
		,ag.AppgroupName&#x0D;
		,c.[Name] as [ContactName]&#x0D;
		,c.[ContactType]&#x0D;
		,c.[Email] as [ContactEmail]&#x0D;
				&#x0D;
		FROM [Application] a  &#x0D;
		LEFT JOIN [AppGroup] ag on ag.AppGroupID = a.AppGroupID&#x0D;
		LEFT JOIN [Contact] c ON c.ItemID = ag.AppGroupID  and ItemType = ''Appgroup''&#x0D;
		LEFT JOIN [User] u ON u.userID = c.UserID&#x0D;
&#x0D;
		where a.ApplicationID = @ItemID AND c.ContactType = ''App Owner''','Application','Event - App - Owner')
GO
INSERT INTO A_templateSQLStatement ( [templateSQLStatementID], [TemplateType], [SQLStatement], [Itemtype], [SetREF]) VALUES('13','Event - App - Tester','SELECT  DISTINCT ''APPLICATION'' as [NOTIFICATIONTYPE]&#x0D;
&#x0D;
		,@ItemID as ItemID&#x0D;
	,iif(IsNull(c.Email,'''')='''',IsNull(u.[Email],''''),c.Email) as [SendToEmail]&#x0D;
&#x0D;
		,a.*&#x0D;
		,IsNull(u.[Email],'''') AS userEmail&#x0D;
		,ag.AppgroupName&#x0D;
		,c.[Name] as [ContactName]&#x0D;
		,c.[ContactType]&#x0D;
		,c.[Email] as [ContactEmail]&#x0D;
				&#x0D;
		FROM [Application] a  &#x0D;
		LEFT JOIN [AppGroup] ag on ag.AppGroupID = a.AppGroupID&#x0D;
		LEFT JOIN [Contact] c ON c.ItemID = ag.AppGroupID  and ItemType = ''Appgroup''&#x0D;
		LEFT JOIN [User] u ON u.userID = c.UserID&#x0D;
&#x0D;
		where a.ApplicationID = @ItemID AND c.ContactType = ''Tester''','Application','Event - App - Tester')
GO
