INSERT INTO Odata_json ( [oID], [dataName], [jsonValue], [keys], [URL], [description], [permissionsNeeded], [jsonDataStart], [dataUpdateSQL], [active]) VALUES('11','secureScores','[{"id":"ed4f9e7a-93d3-412f-9203-6a7f1cb4d409_2022-12-29","azureTenantId":"ed4f9e7a-93d3-412f-9203-6a7f1cb4d409","activeUserCount":10,"createdDateTime":"2022-12-29T00:00:00Z","currentScore":65.5,"enabledServices":["HasSPOP1","HasAADFree"],"licensedUserCount":110,"maxScore":231.0,"vendorInformation":{"provider":"SecureScore","providerVersion":null,"subProvider":null,"vendor":"Microsoft"},"averageComparativeScores":[],"controlScores":[{"controlCategory":"Identity","controlName":"RoleOverlap","description":"Ensure that your administrators can accomplish their work with the least amount of privilege assigned to their account. Assigning users roles like Password Administrator or Exchange Online Administrator, instead of Global Administrator, reduces the likelihood of a global administrative privileged account being breached.","score":1.0,"count":"3","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 3 users with least privileged administrative roles.","scoreInPercentage":100.0,"controlState":"active"},{"controlCategory":"Identity","controlName":"UserRiskPolicy","description":"With the user risk policy turned on, Azure Active Directory detects the probability that a user account has been compromised. As an administrator, you can configure a user risk Conditional Access policy to automatically respond to a specific user risk level. For example, you can block access to your resources or require a password change to get a user account back into a clean state.","score":0.0,"count":"10","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 10 users out of 10 that do not have user risk policy enabled.","scoreInPercentage":0.0,"controlState":"active","total":"10"},{"controlCategory":"Identity","controlName":"OneAdmin","description":"Having more than one global administrator helps if you are unable to fulfill the needs or obligations of your organization. It''s important to have a delegate or an emergency account someone from your team can access if necessary. It also allows admins the ability to monitor each other for signs of a breach.","score":1.0,"count":"4","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You currently have 4 global admins.","scoreInPercentage":100.0,"controlState":"active"},{"controlCategory":"Identity","controlName":"BlockLegacyAuthentication","description":"Today, most compromising sign-in attempts come from legacy authentication. Older office clients such as Office 2010 don\u2019t support modern authentication and use legacy protocols such as IMAP, SMTP, and POP3. Legacy authentication does not support multifactor authentication (MFA). Even if an MFA policy is configured in your environment, bad actors can bypass these enforcements through legacy protocols.","score":0.0,"count":"10","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 10 of 10 users that don''t have legacy authentication blocked.","scoreInPercentage":0.0,"controlState":"active","total":"10"},{"controlCategory":"Identity","controlName":"MFARegistrationV2","description":"Multifactor authentication (MFA) helps protect devices and data that are accessible to these users. Adding more authentication methods, such as the Microsoft Authenticator app or a phone number, increases the level of protection if one factor is compromised.","score":2.7,"count":"7","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 7 out of 10 users that aren\u2019t registered with MFA.","scoreInPercentage":29.99,"controlState":"active","total":"10"},{"controlCategory":"Identity","controlName":"AdminMFAV2","description":"&lt;p&gt;Requiring multifactor authentication (MFA) for administrative roles makes it harder for attackers to access accounts. Administrative roles have higher permissions than typical users. If any of those accounts are compromised, your entire organization is exposed. At a minimum, protect the following roles:&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Global administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Authentication administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Billing administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Conditional Access administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Exchange administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Helpdesk administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;Security administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;SharePoint administrator&amp;nbsp;&lt;/li&gt;&lt;li&gt;User administrator&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;","score":7.5,"count":"1","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 1 out of 4 users with administrative roles that aren\u2019t registered and protected with MFA.","scoreInPercentage":75.0,"controlState":"active","total":"4"},{"controlCategory":"Identity","controlName":"SelfServicePasswordReset","description":"With self-service password reset in Azure Active Directory, users no longer need to engage help desk to reset passwords. This feature works well with Azure AD dynamically banned passwords, which prevents easily guessable passwords from being used.","score":0.3,"count":"7","IsApplicable":"true","lastSynced":"2022-12-29T00:00:00Z","IsEnforced":"false","implementationStatus":"You have 7 of 10 users who don''t have self-service password reset enabled.","scoreInPercentage":30.0,"controlState":"active","total":"10"},{"controlCategory":"Identity","controlName":"PWAgePolicyNew","description":"Research has found that when periodic password resets are enforced, passwords become less secure. Users tend to pick a weaker password and vary it slightly for each reset. If a user 