Category":"Apps","controlName":"mdo_connectionfilter","description":"&lt;p&gt;If you''re a Microsoft 365 customer with mailboxes in Exchange Online or a standalone Exchange Online Protection (EOP) customer without Exchange Online mailboxes, EOP offers multiple ways of ensuring that users will receive email from trusted senders. These options include Exchange mail flow rules (also known as transport rules), Outlook Safe Senders, the IP Allow List (connection filtering), and allowed sender lists or allowed domain lists in anti-spam policies. Collectively, you can think of these options as safe sender lists. &lt;br&gt; &lt;br&gt; The available safe sender lists are described in the following list in order from most recommended to least recommended: &lt;br&gt; 1. Mail flow rules &lt;br&gt; 2. Outlook Safe Senders &lt;br&gt; 3. IP Allow List (connection filtering) &lt;br&gt; 4. Allowed sender lists or allowed domain lists (anti-spam policies)&lt;/p&gt; &lt;p&gt;Without additional verification like mail flow rules, email from sources in the IP Allow List skips spam filtering and sender authentication (SPF, DKIM, DMARC) checks. Since the IP Allow List doesn''t prevent malware or high confidence phishing messages from being filtered, this creates a high risk of attackers successfully delivering email to an inbox that would otherwise be filtered.&lt;/p&gt;","score":1.0,"IsApplicable":"true","lastSynced":"2022-12-29T15:10:27Z","implementationStatus":"The allowed IP addresses list in the connection filter policy is empty ","source":"ingestion","scoreInPercentage":100.0,"on":"true"},{"controlCategory":"Data","controlName":"mip_purviewlabelconsent","description":"\n        To get work done, people in your organization collaborate with others both inside and outside the organization. Data doesn''t always stay in your cloud, and often roams everywhere\u2014across  devices, apps, and services. When your data roams, you still want it to be secure in a way that meets your organization''s business and compliance policies.\n        &lt;br/&gt;\n        &lt;br/&gt;\n        Applying sensitivity labels to your content helps you keep your data secure by stating how sensitive certain data is in your organization. It also abstracts the data itself, letting you track the type of data without exposing sensitive data on other platforms.\n        &lt;br/&gt;\n        &lt;br/&gt;\n        For example, applying the sensitivity label \u2018highly confidential\u2019 to a document that contains social security numbers and credit card numbers helps you identify the sensitivity of the document without knowing the actual data in the document.\n        &lt;br/&gt;\n        &lt;br/&gt;\n        The sensitivity labels created in Microsoft Purview Information Protection can also be extended to the Microsoft Purview data map. When you apply a label on an office document and then scan it into the Microsoft Purview data map, the label will be applied to the data asset. \n    ","score":0.0,"IsApplicable":"true","lastSynced":"2022-12-29T15:10:27Z","implementationStatus":"The setting was not enabled.","source":"ingestion","scoreInPercentage":0.0,"on":"false"},{"controlCategory":"Data","controlName":"mip_sensitivitylabelspolicies","description":"Set up and use data classification policies on data stored in your users'' Office apps (like Outlook and Word), SharePoint sites, and Office 365 groups. \n&lt;br/&gt;\n&lt;br/&gt;\nThe policies will help categorize your most important data so you can effectively protect it from illicit access and will help make it easier to investigate discovered breaches. \n&lt;br/&gt;\n&lt;br/&gt;\nCreation of data classification policies will not cause a significant impact to an organization. However, ensuring long term adherence with policies can potentially be a significant training and ongoing compliance effort across an organization. Organizations should ensure that training and compliance planning is part of the classification policy creation process.\n&lt;br/&gt;\n&lt;br/&gt;\n&lt;i&gt;This information was taken from Center for Internet Security (CIS).&lt;/i&gt;\n    ","score":0.0,"count":"0","IsApplicable":"true","lastSynced":"2022-12-29T15:10:27Z","implementationStatus":"Policies were published on 0 of the 10 users","source":"ingestion","scoreInPercentage":0.0,"total":"10"},{"controlCategory":"Data","controlName":"mip_autosensitivitylabelspolicies","description":"\n        Create auto-labeling policies to automatically apply sensitivity labels to email messages or OneDrive and SharePoint files that contain sensitive info.\n        &lt;br/&gt;\n        This ability to apply sensitivity labels to content automatically is important because:\n        &lt;br/&gt;\n        You don''t need to train your users on the appropriate way to use each of your classifications. \n        &lt;br/&gt;\n        You don''t need to rely on users to classify all content correctly. \n        &lt;br/&gt;\n        Users no longer need to know about your policies\u2014they can instead focus on their work.\n    ","score":0.0,"count":"0","IsApplicable":"true","lastSynced":"2022-12-29T15:10:27Z","implementationStatus":"Policies were published on 0 of the 10 users","source":"ingestion","scoreInPercentage":0.0,"total":"10"},{"controlCategory":"Apps","controlName":"mdo_highconfidencespamaction","description":"Set the action that will be taken on high confidence spam detection.","score":0.0,"count":"0","mdoImplementationStatus":"{\"Policies\":[{\"PolicyName\":\"Default\",\"Status\":1,\"UsersInPolicy\":10,\"MissingDomains\":null}],\"TotalUsers\":10}","IsApplicable":"true","lastSynced":"2022-12-29T15:10:27Z","noPolicies":"false","implementationStatus":"","source":"ingestion","scoreInPercentage":0.0,"total":"10"},{"controlCategory":"Apps","controlName":"mdo_phisspamacation","description":"Set the action that will be taken on phishing detection.","score":0.0,"count":"0","mdoImplementationStatus":"{\"Policies\":[{\"PolicyName\":\"Default